import React, { useState, useEffect } from "react";
import { useNavigate, useParams } from "react-router-dom";
import axios from "axios";
import Cookies from "js-cookie";
export function AdminUpdate() {
    const [values, setValues] = useState({
        userID: Cookies.get("UserID")
    })
    const navigate = useNavigate();
    const { id } = useParams();

    useEffect(() => {
        axios.get('https://localhost:44319/api/Vehicle/' + id)
            .then(res => {
                setValues(res.data)
            })
            .catch(err => console.log(err));
    }, [])

    const handleSubmit = (event) => {
        event.preventDefault();
        console.log(values);
        axios.put('https://localhost:44319/api/Vehicle/' + id, values)
            .then(res => {
                console.log(res.data);
                alert('car details updated successfully..');
                navigate('/dashboard');
            })
            .catch(err => console.log(err));
    }
    return (
        <>
            <form className="card container mt-1 p-5 text-uppercase" onSubmit={handleSubmit} >
                <h3 className="text-center">Update Restaurant</h3>

                <div className="mb-3 " >
                    <label>Restaurant Name</label>
                    <input
                            type="text"
                            name="name"
                            className="form-control"
                            placeholder="Enter Restaurant Name"
                            value={values.Restaurant_Name}
                            onChange={e => setValues({ ...values, Restaurant_Name: e.target.value })}
                            required
                        />
                </div>

                <div className="mb-3">
                    <label>Email Id</label>
                    <input
                            type="email"
                            name="email"
                            className="form-control"
                            placeholder="Enter Email"
                            value={values.Email_Id}
                            onChange={e => setValues({ ...values, Email_Id: e.target.value })}
                            required
                        />
                </div>

                <div className="mb-3">
                    <label>Contact Number</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Vehicle Type"
                        required
                        value={values.vehicleType}
                        onChange={e => setValues({ ...values, vehicleType: e.target.value })}
                    />
                </div>

                <div className="mb-3">
                    <label>Password</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Location"
                        required
                        value={values.location}
                        onChange={e => setValues({ ...values, location: e.target.value })}
                    />
                </div>
                <div className="mb-3">
                    <label>Location</label>
                    <input
                        type="month"
                        className="form-control"
                        placeholder="Year of Make"
                        required
                        value={values.yearOfMake}
                        onChange={e => setValues({ ...values, yearOfMake: e.target.value })}
                    />
                </div>

                <div className="mb-3">
                    <label>Type</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="IDV value"
                        required
                        value={values.idVvalue}
                        onChange={e => setValues({ ...values, idVvalue: e.target.value })}
                    />
                </div>
                <div className="mb-3">
                    <label>Cuisine</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="IDV value"
                        required
                        value={values.idVvalue}
                        onChange={e => setValues({ ...values, idVvalue: e.target.value })}
                    />
                </div>
                <div className="mb-3">
                    <label>Total Tables</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="IDV value"
                        required
                        value={values.idVvalue}
                        onChange={e => setValues({ ...values, idVvalue: e.target.value })}
                    />
                </div>
                <div className="mb-3">
                    <label>Status</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="IDV value"
                        required
                        value={values.idVvalue}
                        onChange={e => setValues({ ...values, idVvalue: e.target.value })}
                    />
                </div>
                <div className="mb-3">
                    <label>Personal Email</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="MFG Name"
                        required
                        value={values.vehicleName}
                        onChange={e => setValues({ ...values, vehicleName: e.target.value })}
                    />
                </div>

                {/* <div className="mb-3">
                    <label>User ID</label>
                    <input
                        type="text"
                        className="form-control"
                        placeholder="User ID"
                        value={id}
                        onChange={e => setValues({ ...values, userID: e.target.value })}
                    />
                </div> */}


                <div className="d-grid">
                    <button type="submit" className="btn btn-primary">
                        Submit
                    </button>
                </div>
            </form>
        </>
    );
}
